import React from "react";
import "./CSS/Home.css";

const Home = () => {
  return (
    <div className="HomePage">
      <div className="Main">
        <div className="container">
          <div className="left">
            <div className="info">
              <h1>Sahil Pillania</h1>
              <h3>I am a Developer</h3>
              <h5>I am pursuing MERN stack nowdays.</h5>
            </div>
          </div>
          <div className="right">
            <div className="logo">
              <img src="./Images/logo.png" alt="" />
            </div>
          </div>
        </div>
        <div className="container">
          <div className="left"></div>
          <div className="right"></div>
        </div>
      </div>
    </div>
  );
};

export default Home;
